import React, { Component } from "react";

class Page extends Component {
  constructor(props) {
    super(props);
    this.state = {
      color: "red"
    };
  }

  styles = {
    color: this.state.color
  };

  render() {
    return <div style={this.styles} />;
  }
}

export default Page;
